def maxSum(nums):
    if not nums:
        return 0
    prev_incl = 0
    prev_excl = 0
    for num in nums:
        current_incl = prev_excl + num
        current_excl = max(prev_incl, prev_excl)
        prev_incl, prev_excl = current_incl, current_excl
    return max(prev_incl, prev_excl)
